INSERT INTO tcepr.tipo_motivo_rescisao_contrato VALUES (4, 'Atraso Injustificado');
INSERT INTO tcepr.tipo_motivo_rescisao_contrato VALUES (5, 'Paralisação da obras, do serviço ou fornecimento, sem justa causa e prévia comunicação à Adminsitração');
INSERT INTO tcepr.tipo_motivo_rescisao_contrato VALUES (6, 'Subcontratação, associação do contrato a outrem, cessão ou transferência, cisão, fusão ou incorporação não admitidas no edital do contrato');
INSERT INTO tcepr.tipo_motivo_rescisao_contrato VALUES (7, 'Desatendimento das determinações regulares da autoridade designada para acompanhar e fiscalizar a sua execução, assim como as de seus superiores');
INSERT INTO tcepr.tipo_motivo_rescisao_contrato VALUES (8, 'Decretação de falência ou a instauração de insolvência civil');
