INSERT INTO tcepr.tipo_motivo_rescisao_contrato VALUES (11, 'Razões de interesse público, de alta relevância e amplo conhecimento, justificadas e determinadas pela máxima autoridade da esfera administrativa a que está subordinado o contratante e exaradas no processo administrativo a que se refere o contrato');
INSERT INTO tcepr.tipo_motivo_rescisao_contrato VALUES (12, 'Supressão, por parte da Administração, de obras, serviços ou compras, acarretando modificação do valor inicial do contrato além do limite permitido no § 1o do art. 65 desta Lei');
INSERT INTO tcepr.tipo_motivo_rescisao_contrato VALUES (13, 'Não liberação, por parte da Administração, de área, local ou objeto para execução de obra, serviço ou fornecimento, nos prazos contratuais, bem como das fontes de materiais naturais especificadas no projeto');
INSERT INTO tcepr.tipo_motivo_rescisao_contrato VALUES (14, 'Ocorrência de caso fortuito ou de força maior, regularmente comprovada, impeditiva da execução do contrato');
